import { BrowserRouter, Routes, Route } from "react-router-dom"



//Routes 

import { Home } from './pages/Home'


//Components

import { Navbar } from './components/Navbar'
import { Footer } from './components/Footer'



export const App = ()=>{



    return(

        <>

            <BrowserRouter>
                <Navbar/>
                <Routes>
                    <Route path='/' exact element={<Home/>}/>
                        

                </Routes>

                <Footer/>
            </BrowserRouter>
        </>



    )

}
